boolean equals(Object o){
        if ( this == o ) {
            return true;
        }
        if ( o == null || getClass() != o.getClass() ) {
            return false;
        }

        UserDto userDto = (UserDto) o;

        if ( !Objects.equals( name, userDto.name ) ) {
            return false;
        }
        if ( !Objects.equals( car, userDto.car ) ) {
            return false;
        }
        return Objects.equals( house, userDto.house );

    }
